import re

def main():
    s = input()
    t = input()
    s = re.split(':', s)
    t = re.split(':', t)
    s = int(s[0]) * 60 + int(s[1])
    t = int(t[0]) * 60 + int(t[1])
    p = s - t
    if p < 0:
        p += 24 * 60
    p = str(p // 60) + ':' + str(p % 60)
    print(p)

if __name__ == '__main__':
    main()
